import "./Character.css";

import characters from "../db/Character/Character";


function Character(){
const done = 
        <ul>
            {characters.map((car) => (
                <li>{car}</li>
              ))}
        </ul>
    return (
        <div>
            <h1>Render Lists in React JSX Template Examples</h1>
    
            <h4>Array Items</h4>
            
          </div>
      );
}
export default Character;
